export class Proyectos{
    id?: number;
    titulo: string;
    descripcion: string;
    link: string;

    constructor(id: number, titulo: string, descripcion: string, link: string) {
        
        this.id = id;
        this.titulo = titulo;
        this.descripcion = descripcion;
        this.link = link;
        }
}
